import React from "react";
import Data from "../../data/line_Chart_Data.json";
import {
  ResponsiveContainer,
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Legend,
  Tooltip,
} from "recharts";
const LineChartDiagram = () => {
  return (
    <>
      <ResponsiveContainer width="100%" aspect={3}>
        <LineChart
          data={Data}
          width={500}
          height={800}
          margin={{ top: 25, right: 2 }}
        >
          <CartesianGrid strokeDasharray="5 5" />
          <XAxis
            dataKey="name"
            interval={"preserveStartEnd"}
            tickFormatter={(value) => value + "Pro"}
          />
          <YAxis tickCount={9} />
          <Tooltip contentStyle={{ backgroundColor: "yellow" }} />
          <Legend verticalAlign="top" height={36} />
          <Line dataKey="student" stroke="red" activeDot={{ r: 8 }} />
          <Line
            type="monotone"
            dataKey="fees"
            stroke="green"
            activeDot={{ r: 8 }}
          />
        </LineChart>
      </ResponsiveContainer>
    </>
  );
};

export default LineChartDiagram;
